import { createRouter, createWebHistory } from 'vue-router';
import RegisterForm from '../components/RegisterForm.vue';
import CreatePasswordForm from '../components/CreatePasswordForm.vue';

const routes = [
  { path: '/', name: 'Register', component: RegisterForm }, // Página principal
  { path: '/create-password', name: 'CreatePassword', component: CreatePasswordForm }, // Formulario de creación de contraseña
  // Redirige rutas no encontradas a la página principal
  { path: '/:pathMatch(.*)*', redirect: '/' },
];

const router = createRouter({
  history: createWebHistory(),
  routes,
});

export default router;
